import{_ as e,o as r,c as t,O as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 20-88.65 Administrative enforcement of orders.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/20-88.65.md","filePath":"vacode/20-88.65.md"}'),n={name:"vacode/20-88.65.md"},a=o('<h1 id="§-20-88-65-administrative-enforcement-of-orders" tabindex="-1">§ 20-88.65 Administrative enforcement of orders. <a class="header-anchor" href="#§-20-88-65-administrative-enforcement-of-orders" aria-label="Permalink to &quot;§ 20-88.65 Administrative enforcement of orders.&quot;">​</a></h1><p>A. A party or support enforcement agency seeking to enforce a foreign support order, or a support order or an income-withholding order, or both, issued in another state, may send the documents required for registering the order to a support enforcement agency of the Commonwealth.</p><p>B. Upon receipt of the documents, the support enforcement agency, without initially seeking to register the order, shall consider and, if appropriate, use any administrative procedure authorized by the law of the Commonwealth to enforce a support order or an income-withholding order, or both. If the obligor does not contest administrative enforcement, the order need not be registered. If the obligor contests the validity or administrative enforcement of the order, the support enforcement agency shall register the order pursuant to this chapter.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0673" target="_blank" rel="noreferrer">673</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0754" target="_blank" rel="noreferrer">754</a>; 2015, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0727" target="_blank" rel="noreferrer">727</a>.</p>',4),i=[a];function s(c,d,h,p,f,l){return r(),t("div",null,i)}const _=e(n,[["render",s]]);export{g as __pageData,_ as default};
